var title_f20_63_21496="Life cycle of echinococcosis";
var content_f20_63_21496=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F86230&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F86230&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 620px\">",
"   <div class=\"ttl\">",
"    Life cycle of echinococcosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 600px; height: 452px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Causal agents: Human echinococcosis (hydatidosis, or hydatid disease) is caused by the larval stages of cestodes (tapeworms) of the genus",
"    <em>",
"     Echinococcus",
"    </em>",
"    .",
"    <em>",
"     Echinococcus granulosus",
"    </em>",
"    causes cystic echinococcosis, the form most frequently encountered;",
"    <em>",
"     E. multilocularis",
"    </em>",
"    causes alveolar echinococcosis;",
"    <em>",
"     E. vogeli",
"    </em>",
"    causes polycystic echinococcosis; and",
"    <em>",
"     E. oligarthrus",
"    </em>",
"    is an extremely rare cause of human echinococcosis.",
"    <br>",
"     The adult",
"     <em>",
"      Echinococcus granulosus",
"     </em>",
"     (3 to 6 mm long)",
"     <strong>",
"      (1)",
"     </strong>",
"     resides in the small bowel of the definitive hosts, dogs, or other canids. Gravid proglottids release eggs",
"     <strong>",
"      (2)",
"     </strong>",
"     that are passed in the feces. After ingestion by a suitable intermediate host (under natural conditions: sheep, goat, swine, cattle, horses, camel), the egg hatches in the small bowel and releases an oncosphere",
"     <strong>",
"      (3)",
"     </strong>",
"     that penetrates the intestinal wall and migrates through the circulatory system into various organs, especially the liver and lungs. In these organs, the oncosphere develops into a cyst",
"     <strong>",
"      (4)",
"     </strong>",
"     that enlarges gradually, producing protoscolices and daughter cysts that fill the cyst interior. The definitive host becomes infected by ingesting the cyst-containing organs of the infected intermediate host. After ingestion, the protoscolices",
"     <strong>",
"      (5)",
"     </strong>",
"     evaginate, attach to the intestinal mucosa",
"     <strong>",
"      (6)",
"     </strong>",
"     , and develop into adult stages",
"     <strong>",
"      (1)",
"     </strong>",
"     in 32 to 80 days. The same life cycle occurs with",
"     <em>",
"      E. multilocularis",
"     </em>",
"     (1.2 to 3.7 mm), with the following differences: the definitive hosts are foxes, and to a lesser extent dogs, cats, coyotes, and wolves; the intermediate host are small rodents; and larval growth (in the liver) remains indefinitely in the proliferative stage, resulting in invasion of the surrounding tissues. With",
"     <em>",
"      E. vogeli",
"     </em>",
"     (up to 5.6 mm long), the definitive hosts are bush dogs and dogs; the intermediate hosts are rodents; and the larval stage (in the liver, lungs, and other organs) develops both externally and internally, resulting in multiple vesicles.",
"     <em>",
"      E. oligarthrus",
"     </em>",
"     (up to 2.9 mm long) has a life cycle that involves wild felids as definitive hosts and rodents as intermediate hosts. Humans become infected by ingesting eggs",
"     <strong>",
"      (&Delta;)",
"     </strong>",
"     , with resulting release of oncospheres",
"     <strong>",
"      (&loz;)",
"     </strong>",
"     in the intestine and the development of cysts",
"     <strong>",
"      (*)",
"     </strong>",
"     in various organs.",
"     <br>",
"      <em>",
"       E. granulosus",
"      </em>",
"      occurs practically worldwide, and more frequently in rural, grazing areas where dogs ingest organs from infected animals.",
"      <em>",
"       E. multilocularis",
"      </em>",
"      occurs in the northern hemisphere, including central Europe and the northern parts of Europe, Asia, and North America.",
"      <em>",
"       E. vogeli",
"      </em>",
"      and",
"      <em>",
"       E. oligarthrus",
"      </em>",
"      occur in Central and South America.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Reproduced from: The Centers for Disease Control and Prevention. Parasites and Health: Echinococcosis. Available at:",
"       <a href=\"file://www.dpd.cdc.gov/dpdx/html/Echinococcosis.htm\" target=\"_blank\">",
"        file://www.dpd.cdc.gov/dpdx/html/Echinococcosis.htm",
"       </a>",
"       .",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
