" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Lichen planus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 353px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Note the shiny, flat, polygonal, violaceous papules.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Beth G Goldstein, MD and Adam O Goldstein, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Lichen planus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 314px; height: 396px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Lichen planus of the dorsum of the hand and wrist. Notice the violaceous color of the papules and the linear K&ouml;ebner's phenomenon.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Sauer, GC, Hall, JC. Manual of skin diseases, 7th ed, Lippincott-Raven, Philadelphia 1996. Copyright &copy; 1996 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Generalized lichen planus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 335px; height: 396px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Violaceous and hyperpigmented polygonal papules are present in a widespread distribution in this patient with generalized lichen planus.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Wolters Kluwer. Copyright &copy; 2008.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
