var title_f20_63_21500="Questions about alcohol abuse and dependence";
var content_f20_63_21500=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F78358&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F78358&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Questions that ask about alcohol abuse and dependence symptoms",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        In the past year, have you...",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Had times when you ended up drinking more, or longer, than you intended?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        More than once wanted to cut down or stop drinking, or tried to, but couldn't?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        More than once gotten into situations while or after drinking that increased your chances of getting hurt (such as driving, swimming, using machinery, walking in a dangerous area, or having unsafe sex)?*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Had to drink much more than you once did to get the effect you want? Or found that your usual number of drinks had much less effect than before?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Continued to drink even though it was making you feel depressed or anxious or adding to another health problem? Or after having had a memory blackout?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Spent a lot of time drinking? Or being sick or getting over other after effects?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Continued to drink even though it was causing trouble with your family or friends?*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Found that drinking, or being sick from drinking, often interfered with taking care of your home or family? Or caused job troubles? Or school problems?*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Given up or cut back on activities that were important or interesting to you, or gave you pleasure, in order to drink?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        More than once gotten arrested, been held at a police station, or had other legal problems because of your drinking?*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Found that when the effects of alcohol were wearing off, you had withdrawal symptoms, such as trouble sleeping, shakiness, restlessness, nausea, sweating, a racing heart, or a seizure? Or sensed things that were not there?",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Questions related to abuse criteria (1 criterion is required for abuse). The rest of the questions relate to dependence criteria (3 criteria are required for dependence).",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: National Institute on Alcohol Abuse and Alcoholism. Rethinking Drinking: Alcohol and Your Health. What are symptoms of an alcohol use disorder. Available at:",
"     <a href=\"file://rethinkingdrinking.niaaa.nih.gov/WhatsTheHarm/WhatAreSymptomsOfAnAlcoholUseDisorder.asp\" target=\"_blank\">",
"      file://rethinkingdrinking.niaaa.nih.gov/WhatsTheHarm/WhatAreSymptomsOfAnAlcoholUseDisorder.asp",
"     </a>",
"     (Accessed on January 30, 2012).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
