var title_f20_63_21501="PCV and PPSV23 in high risk";
var content_f20_63_21501=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F62519&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F62519&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for pneumococcal immunization with pneumococcal conjugate vaccine (PCV13) or 23-valent pneumococcal polysaccharide vaccine (PPSV23) for children at high risk* of pneumococcal disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Age",
"       </td>",
"       <td class=\"subtitle1\">",
"        Previous doses",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommendations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &le;23 months",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        PCV13 per schedule for healthy children",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        24 through 71 months",
"       </td>",
"       <td rowspan=\"2\">",
"        4 doses of PCV13",
"       </td>",
"       <td>",
"        1 dose of PPSV23, at least 8 weeks after last dose of PCV13",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Second dose",
"        <sup>",
"         &bull;",
"        </sup>",
"        of PPSV23, 5 years after the first, for children who are immunocompromised, have sickle cell disease, or have functional or anatomic asplenia",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        24 through 71 months",
"       </td>",
"       <td rowspan=\"3\">",
"        4 doses of PCV7",
"       </td>",
"       <td>",
"        1 dose of PCV13, at least 8 weeks after the last dose of PCV7",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 dose of PPSV23, at least 8 weeks after last dose PCV13",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Second dose",
"        <sup>",
"         &bull;",
"        </sup>",
"        of PPSV23, 5 years after the first, for children who are immunocompromised, have sickle cell disease, or have functional or anatomic asplenia",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        24 through 71 months",
"       </td>",
"       <td rowspan=\"3\">",
"        Any incomplete schedule of 3 doses of PCV7 or PCV13",
"       </td>",
"       <td>",
"        1 dose of PCV13, at least 8 weeks after last dose of PCV7 or PCV13",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 dose of PPSV23, 8 weeks after the last dose of PCV13",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Second dose",
"        <sup>",
"         &bull;",
"        </sup>",
"        of PPSV23, 5 years after the first, for children who are immunocompromised, have sickle cell disease, or have functional or anatomic asplenia",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        24 through 71 months",
"       </td>",
"       <td rowspan=\"3\">",
"        Unvaccinated or any incomplete schedule of PCV7 or PCV13 and no doses of PPSV23",
"       </td>",
"       <td>",
"        2 doses of PCV13, 8 weeks apart, beginning at least 8 weeks after the last dose of PCV7 or PCV13",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 dose of PPSV23, 8 weeks after the last dose of PCV13",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Second dose",
"        <sup>",
"         &bull;",
"        </sup>",
"        of PPSV23, 5 years after the first, for children who are immunocompromised, have sickle cell disease, or have functional or anatomic asplenia",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        24 through 71 months",
"       </td>",
"       <td rowspan=\"2\">",
"        1 dose of PPSV23",
"       </td>",
"       <td>",
"        2 doses of PCV13, 8 weeks apart, beginning at least 8 weeks after last dose of PPSV23",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Second dose",
"        <sup>",
"         &bull;",
"        </sup>",
"        of PPSV23, 5 years after the first, for children who are immunocompromised, have sickle cell disease, or have functional or anatomic asplenia",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     PCV7: 7-valent pneumococcal conjugate vaccine; PCV13: 13-valent pneumococcal conjugate vaccine; PPSV23: 23-valent pneumococcal polysaccharide vaccine.",
"     <br/>",
"     * High-risk children include those with sickle cell disease, asplenia, immunodeficiency, chronic heart or lung disease, cerebrospinal fluid leaks, diabetes mellitus, and cochlear implants",
"     <sup>",
"      &Delta;",
"     </sup>",
"     . A single dose of PCV13 may be administered to children ages 6 through 18 years who are at increased risk for invasive pneumococcal disease (regardless of whether they have previously received PCV7 and/or PPSV23).",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     No more than two doses of PPSV23 are recommended.",
"     <br/>",
"     &Delta; A second dose of PPSV23 is",
"     <strong>",
"      not",
"     </strong>",
"     recommended for immunocompetent children with cochlear implants or chronic illness, including chronic heart disease, chronic lung disease, diabetes mellitus, or cerebrospinal fluid leaks.",
"    </div>",
"    <div class=\"reference\">",
"     Based on recommendations from:",
"     <br>",
"      <ol>",
"       <li>",
"        Pneumococcal infections. In: Red Book: 2012 Report of the Committee on Infectious Diseases (29th ed), Pickering LK (Ed), American Academy of Pediatrics, Elk Grove Village, IL 2012. p.571.",
"       </li>",
"       <li>",
"        Updated recommendation from the Advisory Committee on Immunization Practices (ACIP) for use of 7-valent pneumococcal conjugate vaccine (PCV7) in children aged 24-59 months who are not completely vaccinated. MMWR Morb Mortal Wkly Rep 2008; 57:343.",
"       </li>",
"       <li>",
"        Nuorti JP, Whitney CG, Centers for Disease Control and Prevention (CDC). Prevention of pneumococcal disease among infants and children - use of 13-valent pneumococcal conjugate vaccine and 23-valent pneumococcal polysaccharide vaccine - recommendations of the Advisory Committee on Immunization Practices (ACIP). MMWR Recomm Rep 2010; 59:1.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
